dic = {}

for item in res:
    for tag in item["topicTags"]:
        file_name = tag["slug"]
        if file_name in dic:
            dic[file_name].append({
                    "id": item["frontendQuestionId"],
                    "title": item["title"],
                    "slug": item["titleSlug"],
                    "acceptance": str(round(item["acRate"],2))+"%",
                    "difficulty": item["difficulty"]
                })
        else: 
            dic[file_name] = []

for item, val in dic.items():
    with open(f"topic//{item}.json", "w") as outfile:
        outfile.write(json.dumps({"questions": val}, indent=4))
